var title_f39_43_40634="Interstitial pulmonary edema PA";
var content_f39_43_40634=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F53728%7ECARD%2F61783%7ECARD%2F72562%7ECARD%2F75936&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F53728%7ECARD%2F61783%7ECARD%2F72562%7ECARD%2F75936&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pulmonary edema",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 336px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This plain frontal chest radiograph of a 55-year-old male with known coronary artery disease demonstrates characteristic radiographic features of heart failure with interstitial pulmonary edema, bilateral perihilar alveolar edema producing a characteristic butterfly pattern and bilateral pleural effusions.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Photo courtesy of Jonathan Kruskal, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal chest radiograph",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 371px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Posteroanterior view of a normal chest radiograph.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carol M Black, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Heart failure",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 359px; height: 315px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This chest radiograph of a 65-year-old male with dyspnea and orthopnea demonstrates mild pulmonary vascular congestion, septal lymphatic distention (white arrow), interstitial veiling, and enlarged hilar shadows (black arrow), indicative of left ventricular decompensation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Jonathan Kruskal, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal chest radiograph",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 371px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Posteroanterior view of a normal chest radiograph.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carol M Black, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Severe heart failure",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 319px; height: 263px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This chest radiography shows severe heart failure with cardiomegaly, pulmonary vascular congestion with infiltrates in the mid lung fields (white arrow), and a small pleural effusion (black arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Jonathan Kruskal, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal chest radiograph",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 371px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Posteroanterior view of a normal chest radiograph.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carol M Black, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acute left ventricular failure",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 363px; height: 302px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This plain frontal radiograph of the chest of a 30-year-old male demonstrates bilateral perihilar alveolar edema, giving a typical butterfly appearance, with bilateral interstitial edema and pulmonary venous redistribution to the upper lobes. The acute nature of this condition is manifest by the absence of pleural effusions or an enlarged cardiac silhouette.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Photo courtesy of Jonathan Kruskal, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal chest radiograph",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 371px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Posteroanterior view of a normal chest radiograph.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carol M Black, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
