var title_f39_43_40635="Differential diagnosis of vulvar pain";
var content_f39_43_40635=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F77461&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F77461&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Differential diagnosis of vulvar pain",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Vulvovaginitis (eg, candidal infection, desquamative inflammatory vaginitis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sexually transmitted infections (eg, genital herpes)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vulvovaginal lesions (eg, ulcers, erosions, fissures, papules, pustules)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dermatitis, dermatosis (eg, eczema, psoriasis, lichen sclerosus, lichen planus, lichen simplex chronicus)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Allergic reaction (eg, seminal plasma allergy, drug reaction)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vulvar or vaginal intraepithelial neoplasia or cancer",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vaginal atrophy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vaginismus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neurologic causes (eg, referred pain from injury to the pelvic floor, pudendal nerve injury)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vulvodynia (generalized or localized, provoked or unprovoked)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Disorders of the pelvic floor muscles associated with dysfunctional voiding, chronic constipation, musculoskeletal inflammation of pelvic girdle",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Female genital mutilation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Interstitial cystitis/painful bladder syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vulvovaginal manifestations of systemic disease (eg, Crohn's disease, Sj&ouml;gren's syndrome)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Psychosexual issues (anxiety precluding genital or sexual touch, unresolved genital trauma or sexual abuse)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sexual partner issues (inadequate sexual technique; unwelcome, unaroused, and unlubricated sexual activity)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cultural and religious beliefs leading to expectation of pain with touch",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
